const key=CryptoJS.enc.Utf8.parse("shirleyLshirleyL");
function encrypt(word){
    let srcs = CryptoJS.enc.Utf8.parse(word);
    let encrypted = CryptoJS.AES.encrypt(srcs, key, {mode:CryptoJS.mode.ECB,padding: CryptoJS.pad.Pkcs7});
    var hexStr = encrypted.ciphertext.toString().toUpperCase();
    var oldHexStr = CryptoJS.enc.Hex.parse(hexStr);
    var base64Str = CryptoJS.enc.Base64.stringify(oldHexStr);
    return CryptoJS.enc.Base64.stringify(encrypted.ciphertext);
}
function decrypt(word){
    let decrypt = CryptoJS.AES.decrypt(word, key, {mode:CryptoJS.mode.ECB,padding: CryptoJS.pad.Pkcs7});
    return CryptoJS.enc.Utf8.stringify(decrypt).toString();
}
function isNotValid( conditions ) {
    let rules = "(?:')|(?:--)|(/\\*(?:.|[\\n\\r])*?\\*/)|"
        + "(\\b(select|update|union|and|or|delete|insert|trancate|char|into|" +
        "substr|ascii|declare|exec|count|master|into|drop|execute)\\b)";
    let reg = new RegExp(rules);
    return reg.test(conditions);
}
function getURLParams(data){
    if (!data || Object.keys(data).length === 0) {
        return ''
    }
    return '?' + Object.keys(data).map(key => `${key}=${data[key]?data[key]:''}`).join('&')
}
function getURLParamsObject(url){
    let params={}
    if (url.indexOf("?") > -1) {
        let str = url.substring(url.indexOf('?')+1);
        let strs = str.split("&");
        for(let i = 0; i < strs.length; i ++) {
            params[strs[i].split("=")[0]]=unescape(strs[i].split("=")[1]);
        }
    }
    return params;
}
function encryptURL(url) {
    let par=getURLParamsObject(url)
    for(let key in par){
        par[key]=encrypt(par[key])
    }
    return url.indexOf('?')>-1?url.substring(0,url.indexOf('?')):url+getURLParams(par)
}
