$.ajax=function(params){
    params.url=encryptURL(params.url)
    let isValid=true
    if(params.data){
        if(params.data.constructor===Object){
            params.data=JSON.parse(JSON.stringify(params.data))
            for (let key in params.data){
                let val=params.data[key]
                if (val === undefined || val===null) {continue};
                if(val.constructor!==String){
                    val=JSON.stringify(val)
                }
                if(!checksql){//输入不合法
                    isValid=false
                    break
                }else {
                    params.data[key]=encrypt(val)
                }
            }
        }else if(params.data.constructor===String){
            if(isNotValid(params.data)){
                isValid=false
            }else{
                params.data=encrypt(params.data)
            }
        }
    }
    if (params.url == 'createPaper') {
        isValid = true;
    }
    if (isValid){
        const deferred = $.Deferred()
        if(params.success){
            const success=params.success
            params.success=(data)=>{
                let resp=null;
                if(decrypt(data)=='success'||decrypt(data)=='error'||decrypt(data)=='error1'||decrypt(data)=='error2')
                {
                    resp=decrypt(data)
                }
                else {
                    resp=JSON.parse(decrypt(data))
                }
                success(resp)
            }
        }
        params.dataType=null
        _ajax(params)
            .done((data)=>{
                let resp=JSON.parse(decrypt(data))
                deferred.resolve(resp)
            })
            .fail((jqXHR,status,err)=>{
                if(status===200){
                    let resp=JSON.parse(decrypt(jqXHR.responseText))
                    deferred.resolve(resp)
                }else{
                    deferred.reject(jqXHR,status,err)
                }
            })
        return deferred
    }else{
        alert('您输入的内容中包含危险信息，请重新输入。');
        if(params.success){
            params.success({});
        }
    }
}
