function httpPost_aes(URL, PARAMS) {
    var temp = document.createElement("form");
    temp.action = URL;
    temp.method = "post";
    temp.style.display = "none";
    for ( var x in PARAMS) {
        var opt = document.createElement("textarea");
        opt.name = x;
        opt.value = encrypt(PARAMS[x]);
        temp.appendChild(opt);
    }
    document.body.appendChild(temp);
    temp.submit();
    return temp;
}
//防止sql注入
let checksql=true;//输入合法
function getParams(currentparams){
    checksql=true;//初始化
    let params = [];
    for (col of currentparams) {
        if (isNotValid(col.value)) {
            checksql=false;
            break;
        }

        switch (col.type) {
            case 'select':
                if (col.value) {
                    params.push(` ${col.model} = '${col.value}' `);
                }
                break;

            case 'plain':

                if (col.value) {
                    params.push(` ${col.model} like '%${col.value}%' `);
                }
                break;
            case 'time':
                if (col.value && col.value[0] && col.value[1]) {
                    params.push(` ${col.model} between '${moment(col.value[0]).format('YYYY-MM-DD')}' and '${moment(col.value[1]).format('YYYY-MM-DD')}'`);
                }
                break;
            case 'number':
                if (col.value && Number(col.value) && col.operator) {
                    params.push(` ${col.model} ${col.operator} ${Number(col.value)} `);
                }
                break;

        }
    }
    return params.join('and');
}
